import React, { Component } from 'react';
import { Navbar, Nav, NavItem, NavLink } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './Navigator.css'


export default class Navigator extends Component {
    render() {
        return (
        <Navbar fluid="true" collapseOnSelect>

            <Navbar.Brand>
                <Link to="/">MEETEXO</Link>
            </Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse>
                <Nav pullRight>
                    <NavItem eventKey = {1} componentClass={Link} href="/"  to="/">
                    Memebers
                    </NavItem>
                    <NavItem eventKey = {2} componentClass={Link} href="/" to="/discography">
                    Discography
                    </NavItem>
                    <NavItem eventKey = {3} componentClass={Link}  href="/" to="/members">
                    Tests
                    </NavItem>
                </Nav>
            </Navbar.Collapse>
        </Navbar>

        )
    }
}
